import React from 'react';
import { Button } from '../../globalStyles';
import myImage from '../../images/Beatles/beatles.jpg';
import { IconContext } from 'react-icons/lib';
import {
  MusicSection,
  MusicWrapper,
  MusicHeading,
  MusicContainer,
  MusicCard,
  MusicCardInfo,
  MusicCardImg,
  MusicCardPlan,
  MusicCardFeatures,
  MusicCardFeature
} from './Music.elements';

function Music() {
  return (
    <IconContext.Provider value={{ color: '#a9b3c1', size: 64 }}>
      <MusicSection>
        <MusicWrapper>
          <MusicHeading>MUSIC</MusicHeading>
          <MusicContainer>
            <MusicCard to='/music'>
              <MusicCardInfo>
                <MusicCardImg img={Beatles} />
                <MusicCardPlan>The Beatles</MusicCardPlan>
                <MusicCardFeatures>
                  <MusicCardFeature>The Beatles were an English rock band formed in Liverpool in 1960. The line-up of John Lennon, Paul McCartney, George Harrison and Ringo Starr led the band to be regarded as the foremost and most influential in history.</MusicCardFeature>
                </MusicCardFeatures>
                <Button primary>More</Button>
              </MusicCardInfo>
            </MusicCard>
          
          </MusicContainer>
        </MusicWrapper>
      </MusicSection>
    </IconContext.Provider>
  );
}
export default Music;
